import * as React from "react";
import Card from "@mui/material/Card";
import CardHeader from "@mui/material/CardHeader";
import CardMedia from "@mui/material/CardMedia";
import CardContent from "@mui/material/CardContent";
import Typography from "@mui/material/Typography";
import Grid from "@mui/material/Grid"; 
import './InfoCards.css';

export default function InfoCards(props) {
  return (
    <Grid container spacing={{ xs: 4, sm: 8, md: 12, lg: 20 }} style={{ zIndex: 0, position: 'relative' , marginBottom: '50px'}}>
      {props.info.map((info, index) => (
        <Grid item xs={7} sm={7} md={6} lg={6} key={index} style={{ display: 'flex' }}>
          <Card
            sx={{
              width: 300,
              // height: info.height 
            }}
          >
            <CardHeader title={<span style={{ fontFamily: 'sans-serif' }}>{info.title}</span>} />
            <CardMedia
              component="img"
              height="130"
              image={info.image}
              alt={info.title}
              style={{ borderTop: '1px solid black', borderBottom: '1px solid black' }}
            />
            <CardContent>
              <Typography style={{fontFamily: 'sans-serif', color:'black'}} component={'span'} variant="body2" color="text.secondary">
              <ul>
                {info.body.split('|').map((item, index) => (
                  <li key={index}>{item.trim()}</li>
                ))}
              </ul>
                <br/>
                <strong style={{ fontWeight: 'bold' }}>{info.techstack}</strong>
              </Typography>
            </CardContent>
          </Card>
        </Grid>
      ))}
    </Grid>
  );
  
}
